$(document).ready(function(){$('form[class="form-signin"]').submit(function(o){o.preventDefault(),$.ajax({url:"/api",type:"POST",data:{email:$('input[id="inputEmail"]').val(),password:$('input[id="inputPassword"]').val()},accepts:{text:"application/json; charset=utf-8"},success:function(o,n,t){console.log(o),console.log(n)},error:function(o,n,t){console.log(t),console.log(n)}})})});